import React from 'react';
import './AboutUs.css';

function AboutUs() {
  return (
    <div className='AboutUsInfo'>
      <div className='about-section'>
        <p>En esta sección podrás conocer más al respecto de quiénes somos, conjuntamente con la misión y visión del proyecto realizado a su vez  de la unidad de vinculacón de departamento de ciencias de Ciencias Economicas, Administrativas y de Comercio - DCEA.</p>
      </div>

      <div className='about-section'>
        <h2>¿Quienes Somos?</h2>
        <p>Prowess Agronomia es una plataforma creada para aumentar el desarrollo y comercialización de la produccion agricola de todo el pais.</p>
        <p>Nuestro equipo trabaj arduamente para difundir el concepto de la agronomia como sistema.</p>
      </div>

      <div className='about-section'>
        <h2>Misión</h2>
        <p>Aydar al crecimiento economico y productivo de los agrultores,sienda Prowess Agricola un intermediario directo con buena capacidad de negociación y desarrollo de estraegias de comercialización, el mismo que se encargara de la distribución de los productos, en buenas condiciones sin perder su calidad al momento de ser trasladados..</p>
      </div>
      <div className='about-section'>
        <h2>Visión</h2>
        <p>Al 2024 ser una plataforma estable y ser considerados por nuestros benefactores como una opción viable para comercializar sus productos a todo el país.</p>
      </div>
    </div>
  );
}

export default AboutUs;
